import {Component} from 'react'
import './index.css'
import Boolean from '../boolean/index'
import Spelling from '../spelling/index'

class Header extends Component{
    state = {
        blur : true,
    }

    render(){
        const {b} = this.state
        return (
            <div>
                <div className="nav">
                <p>Boolean retrieval model</p>
                <p>spelling correction</p>
            </div>
            {b?<Boolean/>:<Spelling/>}

            </div>
        )
    }
}

export default Header;
